// FRONTEND/src/Pages/ContactUs.js
import React from 'react';
import useDocumentTitle from '../useDocumentTitle'; // Adjust the path if needed
import ContactUs from '../Components/ContactUs/ContactUs'; // Corrected path to the ContactUs component

const Contactus = () => {
  useDocumentTitle("Contact Us - Overlays Clothing"); // Set the page title

  return (
    <div>
      <ContactUs />
    </div>
  );
}

export default Contactus;
